svg.script:
 var svgDoc;
 var pointsGroup;

 function onload() {
 //  java.lang.System.out.println("in onload");
   svgDoc = document;
   pointsGroup = svgDoc.getElementById ('points');

 }

 function drawElement(evt) {
//   java.lang.System.out.println("in drawElement");
   root = svgDoc.getRootElement();
   rootWidth = root.getWidth().getBaseVal().getValue();
   rootHeight = root.getHeight().getBaseVal().getValue(); 
 //  java.lang.System.out.println("rootWidth = " + rootWidth + " rootHeight = " + rootHeight);

   viewBox = root.getViewBox().getBaseVal();
 //  java.lang.System.out.println("viewBox = " + viewBox.getX() + ", " + viewBox.getY() 
 //                                     + ", " + viewBox.getWidth() + ", " + viewBox.getHeight());
   scale = root.getCurrentScale();
   viewX = viewBox.getX() - root.getCurrentTranslate().getX()*viewBox.getWidth()/rootWidth;
   viewY = + viewBox.getY() - root.getCurrentTranslate().getY()*viewBox.getHeight()/rootHeight;

 //  java.lang.System.out.println("viewX = " + viewX + " viewY = " + viewY + " scale = " + scale);

   x = viewX + evt.getScreenX() * viewBox.getWidth()/rootWidth / scale;
   y = viewY + evt.getScreenY() * viewBox.getHeight()/rootHeight / scale;
 //  java.lang.System.out.println("x = " + x + " y = " + y);

   circle = svgDoc.createElement("circle");
   circle.setAttribute("cx", x);
   circle.setAttribute("cy", -y);
   circle.setAttribute("r", "0.020");
   circle.setAttribute("style", "fill:red; stroke:none");
   pointsGroup.appendChild(circle);
 }
